export const OtherProducts = () => {
  return (
    <div className={Styles.wrapper}>
      <a href="#">Post-it notes</a>
      <a href="#">Staplers</a>
      <a href="#">Hole punches</a>
      <a href="#">Binders</a>
      <a href="#">Paper</a>
      <a href="#">Printers</a>
      <a href="#">Post-it notes</a>
      <a href="#">Staplers</a>
      <a href="#">Hole punches</a>
      <a href="#">Binders</a>
      <a href="#">Paper</a>
      <a href="#">Printers</a>
    </div>
  );
};
